export function ProductList(props) {
    return <div className="container">
    <h1>Shop</h1>

    <div className="row">
      <div className="col-md-6">
        <h3>Products</h3>
        <div className="row">


          {props.map((elm) => (
            <tr key={elm.id}>
              <td>{elm.title}</td>
              <td>{elm.category}</td>
              <td>
                <img src={elm.image} alt={elm.title} />
              </td>
              <td>${elm.price}</td>
              <td>
                <button onClick={() => moveToCart(elm)}>Add to Cart</button>
              </td>
            </tr>
          ))}
        </div>
      </div>
      </div>
      </div>
}
